import React from 'react';

import './shop.data.js';

import './all.styles.scss';
import SHOP_DATA  from './shop.data.js';



class AllPage extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            collections: SHOP_DATA
        }
    }

    render() {
        return <div>Shop/All Page</div>
    }
}

export default AllPage;
